import React from 'react';
import { Card, CardContent, Typography, Paper, Box } from '@mui/material';

interface ReviewDataProps {
  data: any;
}

const ReviewData: React.FC<ReviewDataProps> = ({ data }) => {
  const { company, van, contacts } = data;

  const formattedData = {
    empresa: {
      nome: company?.razao_social || '[Razão Social]',
      cnpj: company?.cnpj || '[CNPJ]',
    },
    conta: {
      agencia: company?.agencia || '[Agência]',
      conta: company?.conta_corrente || '[Conta Corrente]',
      convenio: company?.convenio || '[Convênio]',
    },
    dv: company?.dv || '[DV]',
    cnab: company?.cnab || '[CNAB]',
    van: {
      nome: van?.nome || '[Nome da VAN]',
      cnpj: van?.cnpj || '[CNPJ da VAN]',
    },
    contatos: {
      empresa: contacts?.empresa || '[Contato da Empresa]',
      van: contacts?.van || '[Contato da VAN]',
      tecnico: contacts?.tecnico || '[Contato Técnico]',
      gerente: contacts?.gerente || '[Contato do Gerente]',
    },
  };

  const Section = ({ title, children }: { title: string; children: React.ReactNode }) => (
    <Paper sx={{ p: 2, my: 2, backgroundColor: '#f9f9f9', border: '1px solid #ddd' }}>
      <Typography variant="subtitle1" fontWeight="bold" gutterBottom>
        {title}
      </Typography>
      <Box sx={{ pl: 2 }}>{children}</Box>
    </Paper>
  );

  return (
    <Card>
      <CardContent>
        <Typography variant="h6" gutterBottom>
          Carta de Solicitação
        </Typography>

        <Typography variant="body1" paragraph>
          Prezados,
        </Typography>

        <Typography variant="body1" paragraph>
          Solicitamos a gentileza de providenciar os ajustes necessários para a integração entre nossa empresa e a VAN
          informada, conforme os dados abaixo:
        </Typography>

        <Section title="Contratante">
          <Typography variant="body1">Razão Social: {formattedData.empresa.nome}</Typography>
          <Typography variant="body1">CNPJ: {formattedData.empresa.cnpj}</Typography>
          <Typography variant="body1">
            Agência / Conta Corrente: {formattedData.conta.agencia} / {formattedData.conta.conta} - DV: {formattedData.dv}
          </Typography>
          <Typography variant="body1">Convênio: {formattedData.conta.convenio}</Typography>
          <Typography variant="body1">CNAB: {formattedData.cnab}</Typography>
        </Section>

        <Section title="VAN Contratada">
          <Typography variant="body1">Nome: {formattedData.van.nome}</Typography>
          <Typography variant="body1">CNPJ: {formattedData.van.cnpj}</Typography>
        </Section>

        <Section title="Contato da Empresa">
          <Typography variant="body1">{formattedData.contatos.empresa}</Typography>
        </Section>

        <Section title="Contato da VAN">
          <Typography variant="body1">{formattedData.contatos.van}</Typography>
        </Section>

        <Section title="Contato Técnico">
          <Typography variant="body1">{formattedData.contatos.tecnico}</Typography>
        </Section>

        <Section title="Contato do Gerente">
          <Typography variant="body1">{formattedData.contatos.gerente}</Typography>
        </Section>

        <Typography variant="body1" paragraph>
          Aguardamos o retorno com as confirmações necessárias para continuidade do processo.
        </Typography>

        <Typography variant="body1" paragraph>
          Atenciosamente,
        </Typography>

        <Typography variant="body1">{formattedData.empresa.nome}</Typography>
      </CardContent>
    </Card>
  );
};

export default ReviewData;
